export function getVolumes(query) {
  const request = "https://www.googleapis.com/books/v1/volumes?q=" + query;
  fetch(request, {
    method: "GET"
  })
    .then(response => response.json())
    .then(json => {
      let { items } = json;
      console.log(items);
      return items;
    });
}
